What can be said about Thriller that hasn‚Äôt already been said? An outrageously successful album and the entire record could be a greatest hits compilation. 

I was obsessed with the title track when I was younger. (I loved anything horror related). I was fascinated by all the sound effects and Vincent Price‚Äôs ghoulish rap at the end. I had heard and seen clips of the video which I was desperate to see, but the absence of YouTube made it particularly hard to seek out. Needless to say I‚Äôve seen the full video plenty of times in recent years.

A lot of the songs are very overplayed now . It may be corny as hell but I love the MJ/Macca duet: The Girl is Mine. Beat It and Billie Jean are perfect singles but recently the song I most enjoy is Human Nature. A genuinely beautiful song with excellent production by Quincy Jones. It is also sampled to great effect by Nas on his  mighty Illmatic album. 

Thriller is truly iconic and it cemented Michael Jackson‚Äôs claim as the King of Pop. 

